import React from 'react';
import '../styles/Website.css';  // Importing a stylesheet

const Website = () => {
    const newsItems = [
        { title: 'Article Title 1', description: 'Brief description of article 1.' },
        { title: 'Article Title 2', description: 'Brief description of article 2.' },
        { title: 'Article Title 3', description: 'Brief description of article 3.' },
        { title: 'Article Title 4', description: 'Brief description of article 4.' },

        // ...other articles
    ];

    return (
        <div className="website-container">
            <ul className="news-list">
                {newsItems.map((item, index) => (
                    <li className="news-item" key={index}>
                        <h2>{item.title}</h2>
                        <p>{item.description}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Website;
